window.bookSummaryJSON = "<p>The first book in the series that has garnered millions of fans across the globe, from <i>New York Times</i> best-selling author Robert Dugoni. Tracy Crosswhite has spent 20 years questioning the facts surrounding her sister Sarah’s disappearance and the murder trial that followed. She doesn’t believe that Edmund House - a convicted rapist and the man condemned for Sarah’s murder- is the guilty party.&nbsp;</p> <p>Motivated by the opportunity to obtain real justice, Tracy became a homicide detective with the Seattle PD and dedicated her life to tracking down killers. When Sarah’s remains are finally discovered near their hometown in the northern Cascade mountains of Washington State, Tracy is determined to get the answers she’s been seeking.&nbsp;</p> <p>As she searches for the real killer, she unearths dark, long-kept secrets that will forever change her relationship to her past - and open the door to deadly danger.&nbsp;</p>"; 
